n""/><input type=""hidden"" name=""priority-limit"" value=""5""/><div id=""enr-course-view""><h2>Analiza numeryczna (M)</h2><div class=""details course-details""><table class=""table-info""><tr><th>Rodzaj</th><td>Obowiązkowy 2</td></tr><tr><th>Punkty ECTS</th><td>4</td></tr><tr><th>Liczba godzin</th><td>60
