                28 Wrz 2016, 20:45
                </td></tr></table><div class=""description""><h5>Opis przedmiotu:</h5><p><pre>Celem zajęć jest przedstawienie podstawowych metod i algorytm&oacute;w rozwiązywania
typowych zadań obliczeniowych.
<br /><strong>Analiza błęd&oacute;w</strong><br />      Arytmetyka numeryczna. Uwarunkowanie zadania. Algorytmy<br />      numerycznie poprawne.<br /><strong>Rozwiązywanie r&oacute;wnań nieliniowych</strong><br />      Og&oacute;lna teoria metod iteracyjnych. Metody: bisekcji, Newtona<br />      i siecznych. R&oacute;wnania algebraiczne.       <br /><strong>Interpolacja funkcji</strong><br />      Wz&oacute;r interpolacyjny Lagrange'a. Reszta wzoru interpolacyjnego.<br />      Wz&oacute;r interpolacyjny Newtona. Interpolacja Hermite'a.<br />      Interpolacja za pomocą funkcji sklejanych III stopnia.<br /><strong>Aproksymacja funkcji</strong><br />      Aproksymacja średniokwadratowa  za pomocą wielomian&oacute;w &ndash;<br />      wielomiany ortogonalne, twierdzenie o <em>n</em>-tym wielomianie optymalnym.<br />      Aproksymacja jednostajna &ndash; twierdzenie<br />      o alternansie, informacja o algorytmie<br />      Remeza konstrukcji wielomianu optymalnego,<br />      wielomiany prawieoptymalne.<br /><strong>Całkowanie numeryczne</strong><br />      Kwadratura liniowa. Reszta i rząd kwadratury. Zbieżność ciągu<br />      kwadratur. Kwadratury interpolacyjne.<br />      Kwadratury Newtona-Cotesa. Wzory złożone: trapez&oacute;w i Simpsona.<br />      Metoda Romberga. Kwadratury Gaussa.<br /><strong>Rozwiązywanie układ&oacute;w r&oacute;wnań liniowych</strong><br />      Uwarunkowanie zadania. Rozkład macierzy kwadratowej na iloczyn<br />      macierzy tr&oacute;jkątnych. Metoda eliminacji Gaussa. <br />      Metody iteracyjne rozwiązywania układ&oacute;w r&oacute;wnań liniowych.<br /><br /><strong>Literatura</strong><br />A. Bj&ouml;rck, G. Dahlquist, Metody numeryczne, PWN, 1987.
M. Dryja, J.i M. Jankowscy, Przegląd metod i algorytm&oacute;w numerycznych, cz. 1 i 2, WNT, 1988.
D. Kincaid, W. Cheney, Analiza numeryczna, WNT, 2005.
numerycznej, PWN, 1987.<br />G. Dahlquist, A. Bj&ouml;rck, Numerical Methods in Scientific Computing, Vol. I, SIAM, 2008. <br />W. Gautschi, Numerical Analysis. An Introduction, Birkh&auml;user, 1997.
G. H&auml;mmerlin, K.-H. Hoffmann, Numerical Mathematics, Springer-Verlag, 1991.
A. Quarteroni, R. Sacco, F. Saleri, Numerical Mathematics, Springer-Verlag, 2000.</pre></p></div><div class=""footer""></div></div><hr><div class=""tutorial""><h2>Wykłady </h2><input type=""hidden"" name=""tutorial-type"" value=""1""/><table class=""zebra-striped""><thead><tr><th>Prowadzący</th><th class=""term"">Termin zajęć</th><th title=""Maksymalna liczba osób, które mogą zapisać się na przedmiot"" class=""number"">Limit</th><th title=""Liczba aktualnie zapisanych osób"" class=""number termEnrolledHeader"">Zapisani</th><th title=""Liczba osób oczekujących na zapis"" class=""number termQueuedHeader"">Kolejka</th><th class=""controls""></th></tr></thead><tbody><tr  ><td><a href=""/users/profile/employee/36"" class=""person"">
